import React from 'react';
import Proyect from './proyect'

const ListadoProyectos = () => {

    const proyectos = [
        {nombre: 'trabajo de matematicas'},
        {nombre: 'Intranet'},
        {nombre: 'proyecto de diseño web'}
    ]

    return (
        <ul className="listado-proyectos">
            {proyectos.map(e => (
                <Proyect
                    proyecto={e}
                />
            ))}
        </ul>
    );
};

export default ListadoProyectos;
